import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

import './style.scss';

const useStyles = makeStyles((theme) => ({
	modal: {
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'center',
	},
	paper: {
		backgroundColor: theme.palette.background.paper,
		border: '2px solid #000',
		boxShadow: theme.shadows[5],
		padding: theme.spacing(2, 4, 3),
	},
	margin: {
		margin: theme.spacing(1),
	},
	root: {
		'& .MuiTextField-root': {
			margin: theme.spacing(1),
			width: '25ch',
		},
	},
}));

export const PacketNew = () => {
	const classes = useStyles();
	const [open, setOpen] = React.useState(false);

	const handleOpen = () => {
		setOpen(true);
	};

	const handleClose = () => {
		setOpen(false);
	};
	const [name, setName] = React.useState({
		code: '',
		surname: '',
		fees: '',
		discount: '',
		number: '',
		date: '',
	});

	const onChange = (event) => {
		var target = event.target;
		var name = target.name;
		var value = target.value;
		console.log(value);
		setName(([name] = value));
	};
	console.log(name);
	const onSubmit = (event) => {
		event.preventDefault();
	};
	return (
		<div className='PacketNew_button'>
			<button type='button' onClick={handleOpen}>
				Tạo gói tin
			</button>
			<Modal
				aria-labelledby='transition-modal-title'
				aria-describedby='transition-modal-description'
				className={classes.modal}
				open={open}
				onClose={handleClose}
				closeAfterTransition
				BackdropComponent={Backdrop}
				BackdropProps={{
					timeout: 500,
				}}
			>
				<Fade in={open}>
					<div className={classes.paper}>
						<div className='PacketNew_wrapper'>
							<div className='title'>
								<h3>TẠO MỚI GÓI TIN</h3>
							</div>
							<div className='PacketNew_content'>
								<div className='PacketNew_note'>
									<p>Gói Tin được áp dụng với:</p>
									<p>1. Chuyên mục có phí</p>
									<p>2. Tin đăng về Cần bán/ Cho thuê</p>
									<p>3. Không áp dụng đối với banner quảng cáo, quảng cáo cơ bản</p>
								</div>
								<div className='PacketNew__form' onSubmit={onSubmit}>
									<div className='PacketNew__form--file'>
										<TextField id='standard-name' label='Mã gói' name='code' value={name.code} onChange={onChange} />
										<TextField id='standard-name' label='Tên gói' name='surname' value={name.surname} onChange={onChange} />
										<TextField id='standard-name' label='Phí' name='fees' value={name.fees} onChange={onChange} />
										<TextField id='standard-name' label='Chiết khấu' name='discount' value={name.discount} onChange={onChange} />
										<TextField id='standard-name' label='Số lượng tin' name='number' value={name.number} onChange={onChange} />
										<TextField id='standard-name' label='Thời hạn sử dụng' name='date' value={name.date} onChange={onChange} />
									</div>
									<div className='PacketNew__form--button'>
										<Button variant='outlined'>Hủy bỏ</Button>
										<Button variant='outlined' type='submit' value='Submit'>
											Tạo mới
										</Button>
									</div>
								</div>
							</div>
						</div>
					</div>
				</Fade>
			</Modal>
		</div>
	);
};
